import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // To make the sort filter visible, we first need to perform a search
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'phone');

    // There are multiple search buttons, we'll click the first one
    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');

    // Wait for search results and sort controls to appear
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Apply the 'Price: High to Low' sort filter
    await page.selectOption('#sortSelect', 'price-high');

    // Take a screenshot after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sort_applied.png'));

    // Extract the selected value to verify the action
    const selectedSortValue = await page.$eval('#sortSelect', el => el.value);

    return {
      success: true,
      action: "Applied 'Price: High to Low' sort filter after performing a search.",
      extractedData: {
        selectedSort: selectedSortValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
